import Carousel from 'react-bootstrap/Carousel';
import "bootstrap/dist/css/bootstrap.css";

// import Pic1 from '../image/1.jpg';
// import Pic2 from '../image/2.jpg';
// import Pic3 from '../image/3.jpg';
// import Pic4 from '../image/hero_1.jpg';
import Pic4 from '../image/production.mp4';
import Pic5 from '../image/production1.mp4';
import Pic6 from '../image/production3.mp4';
import Pic7 from '../image/production4.mp4';

function CarouselFadeExample() {
  return (
    
    <Carousel fade>
      <Carousel.Item>
             <video src={Pic4} autoPlay="true" width="100%" height="30%" style={{marginTop:'10px'}}/>
        <Carousel.Caption>
          <h3>Mp4 Format Video</h3>
          <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
        </Carousel.Caption>
      </Carousel.Item>

      <Carousel.Item>
        <img className="d-block w-100"
          src={Pic5}
          alt="Second slide"
        />
        <Carousel.Caption>
          <h3>Webp Format Video</h3>
          <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
        </Carousel.Caption>
      </Carousel.Item>

       <Carousel.Item>
        <img
          className="d-block w-100"
          src={Pic6}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h3>Gif Format Video</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={Pic7}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item>

      {/*<Carousel.Item>
        <img
          className="d-block w-100"
          src={Pic4}
          alt="Fourth slide"
        />

        <Carousel.Caption>
          <h3>Fourth slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item> */}

      
    </Carousel>
  );
}

export default CarouselFadeExample;
